import React, { useState} from "react";

function LoginPage() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    const handleUsernameChange = (event) => {
        setUsername(event.target.value);
    };

    const handlePasswordChange = (event) => {
        setPassword(event.target.value);
    };

    const handleSubmit = async (event) => {
        event.preventDefault();
        try {
            const response = await fetch('http', {
                method: 'POST',
                 headers: {
                    'Content-Type': 'application/json',
                 },
                body:JSON.stringify ({username, password}),
                });
                if (!response.ok) {
                    throw new Error('Failed to login');
                }

                console.log('login successful');
        } catch (error) {
            setError('Failed to login, try again');
        }  
    };

    return (
        <div className="bg-white">
            <div className="flex gap-5 max-md:flex-col max-md:gap-0">
                <div className="flex flex-col w-[61%] max-md:ml-0 max-md:w-full">
                    <div className="flex flex-col grow justify-center items-start w-full bg-orange-500 max-md:mt-10 max-md:max-w-full">
                        <img
                            loading="lazy"
                            src="https://cdn.builder.io/api/v1/image/assets/TEMP/b50e6fa0ca60d2e068664f38d718b7dcbe1aa5cc2e324b420fe4c15384fa8deb?apiKey=a5b1225ec57f45f2919be1a5a6e0d786&width=800"
                            className="max-w-full aspect-[0.72] fill-white fill-opacity-10 w-[710px]"
                            alt="Placeholder"
                        />
                    </div>
                </div>
                <div className="flex flex-col ml-5 w-[39%] max-md:ml-0 max-md:w-full">
                    <div className="flex flex-col self-stretch px-5 pb-16 my-auto max-md:mt-10 max-md:max-w-full">
                        <div className="mr-5 text-4xl font-bold tracking-normal leading-10 text-orange-500 max-md:mr-2.5 max-md:max-w-full">
                            Welcome to the <span className="text-orange-500">Admin Page</span>
                        </div>
                        <form onSubmit={handleSubmit}>
                            <div className="mt-2.5 mr-5 text-xl tracking-normal leading-7 text-zinc-400 max-md:mr-2.5 max-md:max-w-full">
                                In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form
                            </div>
                            <div className="flex flex-col justify-center mt-10 max-md:max-w-full">
                                <div className="flex flex-col max-md:max-w-full">
                                    <div className="flex gap-1.5 self-start text-2xl leading-7 whitespace-nowrap">
                                        <div className="grow text-black">Email</div>
                                        <div className="text-orange-500">*</div>
                                    </div>
                                    <input
                                        className="justify-center px-4 py-4 mt-3.5 text-xl leading-7 text-black bg-white border-solid border-[3px] border-stone-300 max-md:max-w-full"
                                        type="text"
                                        value={username}
                                        onChange={handleUsernameChange}
                                        required
                                    />
                                </div>
                                <div className="flex flex-col justify-center mt-6 font-bold tracking-normal whitespace-nowrap max-md:max-w-full">
                                    <div className="flex flex-col max-md:max-w-full">
                                        <div className="flex gap-1.5 self-start text-2xl leading-7">
                                            <div className="grow text-black">Password</div>
                                            <div className="text-orange-500">*</div>
                                        </div>
                                        <input
                                            className="justify-center px-4 py-4 mt-3.5 text-xl leading-7 text-black bg-white border-solid border-[3px] border-stone-300 max-md:max-w-full"
                                            type="password"
                                            value={password}
                                            onChange={handlePasswordChange}
                                            required
                                        />
                                    </div>
                                </div>
                                {error && <div className="flex gap-2 max-md:flex-wrap mt-6 text-sm tracking-normal leading-4 text-black max-md:max-w-full">
                                    <img
                                        loading="lazy"
                                        src="https://cdn.builder.io/api/v1/image/assets/TEMP/3abc1c724ff04347a5e16526604fe95531b39cf50f8b3e5038cce10b3612e495?apiKey=a5b1225ec57f45f2919be1a5a6e0d786&"
                                        className="shrink-0 aspect-square w-[31px]"
                                        alt="Error Icon"
                                    />
                                    <div className="grow justify-center self-start py-1 w-fit">
                                        {error}
                                    </div>
                                </div>}
                                <div className="flex flex-col justify-center mt-6 max-w-full text-xl tracking-normal leading-6 text-center text-black whitespace-nowrap w-[182px]">
                                    <button type="submit" className="justify-center px-7 py-3.5 bg-orange-500 max-md:px-5">
                                        Login
                                    </button>
                                </div>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default LoginPage;
